import React, { Component } from "react";
import "../App.css";
class Test extends Component {
  state = {
    count: 12,
  };
  render() {
    return (
      <h1 className="test">
        Hello <span>{this.state.count}</span>World!
      </h1>
    );
  }
}

export default Test;
